// src/App.jsx
import React, { lazy, Suspense, useEffect } from "react";
import { Routes, Route, useLocation } from "react-router-dom";
import { ClipLoader } from "react-spinners";

// Components عامة
import Navbar from "./components/Navbar.jsx";
import Footer from "./components/Footer.jsx";
import SearchBar from "./components/SearchBar.jsx";
import ScrollToTopButton from "./components/ScrollTopButton.jsx";

// Pages – Lazy Loaded
const Home = lazy(() => import("./pages/Home.jsx"));
const Category = lazy(() => import("./pages/Category.jsx"));
const BookDetails = lazy(() => import("./pages/BookDetails.jsx"));
const Cart = lazy(() => import("./pages/Cart.jsx"));
const Contact = lazy(() => import("./pages/Contact.jsx"));
const SearchResults = lazy(() => import("./pages/SearchResults.jsx"));
const NotFound = lazy(() => import("./pages/NotFound.jsx"));

// Admin Pages
import AdminLogin from "./pages/admin/AdminLogin.jsx";
import ManageBooks from "./pages/admin/ManageBooks.jsx";
import ProtectedRoute from "./pages/admin/ProtectedRoute.jsx";

// دالة للرجوع لأعلى الصفحة عند تغيير الروت
function ScrollToTop() {
    const { pathname } = useLocation();
    useEffect(() => {
        window.scrollTo(0, 0);
    }, [pathname]);
    return null;
}

export default function App() {
    return (
        <div
            className="font-sans bg-gray-50 min-h-screen flex flex-col"
            dir="rtl"
        >
            {/* دائمًا نرجع لأعلى الصفحة عند التنقل */}
            <ScrollToTop />

            <Routes>
                {/* ====================== صفحات الإدارة ====================== */}
                <Route path="/admin/login" element={<AdminLogin />} />
                <Route
                    path="/admin/manage-books"
                    element={
                        <ProtectedRoute>
                            <ManageBooks />
                        </ProtectedRoute>
                    }
                />

                {/* ====================== الصفحات العامة (مع Lazy Loading) ====================== */}
                <Route
                    path="*"
                    element={
                        <>
                            {/* شريط التنقل + شريط البحث */}
                            <Navbar />
                            <div className="bg-white shadow-sm border-b border-gray-200 py-4 px-6 sticky top-0 z-40 shadow-sm">
                                <SearchBar />
                            </div>

                            {/* المحتوى الرئيسي مع Loading جميل */}
                            <main className="flex-1">
                                <Suspense
                                    fallback={
                                        <div className="min-h-screen flex items-center justify-center bg-gray-50">
                                            <div className="text-center">
                                                <ClipLoader
                                                    size={70}
                                                    color="#4F46E5"
                                                />
                                                <p className="mt-6 text-xl text-gray-600">
                                                    جاري تحميل الصفحة...
                                                </p>
                                            </div>
                                        </div>
                                    }
                                >
                                    <Routes>
                                        <Route path="/" element={<Home />} />
                                        <Route
                                            path="/book/:id"
                                            element={<BookDetails />}
                                        />
                                        <Route
                                            path="/category"
                                            element={<Category />}
                                        />
                                        <Route
                                            path="/category/:name"
                                            element={<Category />}
                                        />
                                        <Route
                                            path="/cart"
                                            element={<Cart />}
                                        />
                                        <Route
                                            path="/contact"
                                            element={<Contact />}
                                        />
                                        <Route
                                            path="/search"
                                            element={<SearchResults />}
                                        />
                                        <Route
                                            path="*"
                                            element={<NotFound />}
                                        />
                                    </Routes>
                                </Suspense>
                            </main>

                            {/* الفوتر + زر الرجوع للأعلى */}
                            <Footer />
                            <ScrollToTopButton />
                        </>
                    }
                />
            </Routes>
        </div>
    );
}
